import { Navigate } from 'react-router-dom';

const ProtectedRoute = ({ children }) => {
    const token = localStorage.getItem('token');
    if (!token) {
        return <Navigate to="/" />;
    }
    return children; // Yahan Outlet nahi hona chahiye
};

export default ProtectedRoute;
